import React from "react";


const x = [
  {name:'maninder',age:'20'}
]
function Just(data) {
  return (
    <>
      <h1>My Name is {data.name}</h1>
      <h2>My age is {data.age}</h2>
      <p>I'm {data.work}</p>
    </>
  );
}

export default Just;
